import ReactDOM from 'react-dom'
import { BrowserRouter, Routes, Route } from 'react-router-dom'
import home from './Site/home/Site'
import PageNotFound from './Site/PageNotFound/Site'

function App() {

    return (
        <BrowserRouter>
            <Routes>
                <Route index path="/" element={<home/>}/>
                <Route path="/404" component={PageNotFound}/>
            </Routes>
        </BrowserRouter>
    );
}

export default App;
